exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`https://www.umiwx.com/book/${3<bid.length?bid.substring(0,bid.length-3):"0"}/${bid}/`;return parseCatalog(url,[/<ul id="newlist">(?<fragment>(?:\s*<div data-id="\d+">(?:\s*<li>\s*<span>\s*<a[^>]*>[^<]*<\/a>\s*<\/span>\s*<\/li>\s*)*<\/div>\s*)*)/,/<li>\s*<span>\s*<a[^>]*href="(?<url>[^"]+)"[^>]*>(?<name>[^<]*)<\/a>\s*<\/span>\s*<\/li>/g],{...options,transformer:function(raw){const matches=raw.matchAll(/<div data-id="(?<id>\d+)">(?<inner>(?:\s*<li>\s*<span>\s*<a[^>]*>[^<]*<\/a>\s*<\/span>\s*<\/li>\s*)*)<\/div>/g),records=[];for(let m of matches)records.push([parseInt(m.groups.id),m.groups.inner]);return records.sort((a,b)=>a[0]-b[0]).map(_=>_[1]).join("")}})};